import React, { useState } from 'react';
import {
  Box,
  Button,
  Container,
  Paper,
  TextField,
  Typography,
  Alert,
  CircularProgress,
} from '@mui/material';
import axios from 'axios';

// Create axios instance with base URL
const api = axios.create({
  baseURL: 'http://localhost:5000',
  headers: {
    'Content-Type': 'application/json',
  },
});

const LiquidInterface: React.FC = () => {
  const [address, setAddress] = useState<string>('');
  const [assetId, setAssetId] = useState<string>('');
  const [toAddress, setToAddress] = useState<string>('');
  const [amount, setAmount] = useState<string>('');
  const [loading, setLoading] = useState<boolean>(false);
  const [error, setError] = useState<string>('');
  const [success, setSuccess] = useState<string>('');

  const generateAddress = async () => {
    try {
      setLoading(true);
      setError('');
      const response = await api.get('/api/liquid/address');
      setAddress(response.data.address);
      setSuccess('Address generated successfully!');
    } catch (err) {
      console.error('Error generating address:', err);
      setError('Failed to generate address. Please make sure the backend server is running.');
    } finally {
      setLoading(false);
    }
  };

  const getAssetInfo = async () => {
    if (!assetId) {
      setError('Please enter an asset ID');
      return;
    }

    try {
      setLoading(true);
      setError('');
      const response = await api.get(`/api/liquid/asset/${assetId}`);
      setSuccess(`Asset Info: ${JSON.stringify(response.data, null, 2)}`);
    } catch (err) {
      console.error('Error fetching asset info:', err);
      setError('Failed to fetch asset information. Please make sure the backend server is running.');
    } finally {
      setLoading(false);
    }
  };

  const createTransaction = async () => {
    if (!address || !toAddress || !assetId || !amount) {
      setError('Please fill in all fields');
      return;
    }

    try {
      setLoading(true);
      setError('');
      const response = await api.post('/api/liquid/transaction', {
        fromAddress: address,
        toAddress,
        assetId,
        amount: parseFloat(amount),
      });
      setSuccess(`Transaction created with ID: ${response.data.transactionId}`);
    } catch (err) {
      console.error('Error creating transaction:', err);
      setError('Failed to create transaction. Please make sure the backend server is running.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <Container maxWidth="sm">
      <Paper elevation={3} sx={{ p: 4, mt: 4 }}>
        <Typography variant="h4" component="h1" gutterBottom>
          Liquid Network Interface
        </Typography>

        {error && <Alert severity="error" sx={{ mb: 2 }}>{error}</Alert>}
        {success && <Alert severity="success" sx={{ mb: 2 }}>{success}</Alert>}

        <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}>
          <Button
            variant="contained"
            onClick={generateAddress}
            disabled={loading}
            startIcon={loading ? <CircularProgress size={20} /> : null}
          >
            Generate Address
          </Button>

          {address && (
            <TextField
              label="Generated Address"
              value={address}
              fullWidth
              disabled
            />
          )}

          <TextField
            label="Asset ID"
            value={assetId}
            onChange={(e) => setAssetId(e.target.value)}
            fullWidth
          />

          <Button
            variant="contained"
            onClick={getAssetInfo}
            disabled={loading}
            startIcon={loading ? <CircularProgress size={20} /> : null}
          >
            Get Asset Info
          </Button>

          <TextField
            label="To Address"
            value={toAddress}
            onChange={(e) => setToAddress(e.target.value)}
            fullWidth
          />

          <TextField
            label="Amount"
            value={amount}
            onChange={(e) => setAmount(e.target.value)}
            type="number"
            fullWidth
          />

          <Button
            variant="contained"
            onClick={createTransaction}
            disabled={loading}
            startIcon={loading ? <CircularProgress size={20} /> : null}
          >
            Create Transaction
          </Button>
        </Box>
      </Paper>
    </Container>
  );
};

export default LiquidInterface;
